description:
The 2006 reissue of Flogging Molly\'s 1997 live album Alive Behind The Green Door.
Ripped into level 8 FLAC with MediaMonkey for your convenience.
Album cover art linked form the files.

Rough set from the Molly Malone\'s bar where they got their start (and their name), but it\'s Flogging Molly 100% live, darnit. :)

